import logo from './logo.svg';
import './App.css';
import { BrowserRouter, Route, Routes } from 'react-router-dom';
import Home from './Pages/Home';
import Navbar from './Components/Navbar';
import "./App.css";

function App() {
  return (
    <div className="App">
     <BrowserRouter>
     <Navbar />
     <Routes>
      <Route path="/" element={<Home/>} />
      <Route path="/" element={<Home/>} />
     </Routes>
     </BrowserRouter>

    </div>
  );
}

export default App;
